use cas_db;
select Date, CAS_EryUVB_RATIO
from cas_uv_ratio
where Date between '2018-03-22 06:32:00.0' and '2018-03-22 18:44:59.0'
and CAS_EryUVB_RATIO between 0 and 100;

use cas_db;
select Date, photometric
from natural_tracker
where Date between '2018-03-22 06:32:00.0' and '2018-03-22 18:44:59.0';
